import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';
import './App.css';
import Axios from 'axios';
const routes = require('./routes');
const dotenv = require('dotenv');

dotenv.config();

function Restaurants() {

    const [restaurants, restaurantList] = useState([]);

    useEffect(() => {
        Axios.get(routes.listRestaurantsByName).then((result) => {
            restaurantList(result.data);
        })
    })

    return <div className="App">
        <h1>Restaurant App</h1>
        <Link to="/"><Button>Agregar Restaurante
            </Button></Link>
        <div class="divider" />
        <Link to="/reservar"><Button>Hacer Reservas
            </Button></Link>
        <div class="divider" />
        <Link to="/restaurantes"><Button>Lista de Restaurantes
            </Button></Link>
        <div class="divider" />
        <Link to="/reservas"><Button>Lista de Reservas
            </Button></Link>
        <br></br>
        <br></br>
        <Button>Nombre A - Z
            </Button>
        <div class="divider" />
        <Button>Nombre Z - A
            </Button>
        <div class="divider" />
        <Button>Ciudad A - Z
            </Button>
        <div class="divider" />
        <Button>Ciudad Z - A
            </Button>

        <div className='form'>
            <h1>Restaurantes: </h1>
            {restaurants.map((val) => {
                return <div className="card">
                    {val.restaurantName} Ciudad
                        </div>
            })}
        </div>
    </div>;
}

export default Restaurants;
